s($,"aAR","adY",()=>{var q="assets/Office people working.jpg",p="Customer Experience Enhancement",o="Expertiese in detecting fruadulant Claims",n="Lorem Ipsum is a dummy text commonly used in the printing and typesetting industry. It has been the industry's standard placeholder text since the 1500s, when an unknown printer scrambled a galley of type to create a type specimen book. The text is derived from sections of Cicero's De Finibus Bonorum et Malorum, and it serves to fill spaces in design layouts without conveying meaningful content.",m="25 years of experience in the field of investigation and fraud detection. Our team of experts is dedicated to providing top-notch services to our clients, ensuring that every claim is thoroughly investigated and verified. We pride ourselves on our attention to detail and commitment to excellence, making us a trusted partner in the industry.",l=t.s
return A.c([A.Fl(A.c(["Customer Visits and Investigation","Accident scene verification","Witness statements and driver Investigation","Vehicle Inspection and Garage Verification","FIR and Spot Report Verification","CCTV Footage Collection and Forensics","Accident Reconstruction and Analysis",p],l),"Our motor claim investigation service was built 25 years ago to combat the rising trend of fraudulent claims in the insurance sector. Motor insurance fraud is one of the most prevalent risks faced by insurance companies. From staged accidents to inflated repair costs and fake injury claims, the threats are diverse and evolving. Our service ensures that only genuine claims are honored, protecting insurers from losses and policy misuse. \n\nA service designed to validate the authenticity of motor insurance claims and prevent fraud in categories like: \n - Own Damage (OD)\n - Theft\n - Personal Accident (PA)\n - Motor Accident Claims Tribunal (MACT)","On-ground verification is the backbone of a reliable motor claim investigation. Our team of field investigators is trained to crack the toughest of cases. Investigators visit the accident location to collect tangible evidence such as skid marks, debris trails, and vehicle positioning. We also conduct interviews with involved parties\u2014drivers, witnesses, and sometimes even first responders\u2014to cross-check the story provided in the claim report. Vehicle inspection is done meticulously to analyze impact points, damage consistency, mechanical conditions or any modifications. These insights are crucial for understanding how the accident occurred and if it aligns with the insured party\u2019s version of events. Additionally, we coordinate with local law enforcement to gather supporting documents like FIRs, challans or CCTV footage. This holistic, boots-on-the-ground approach helps us uncover misrepresented or staged accidents, protect insurers from fraudulent activities, and uphold fair claim practices.","Our technology driven approach enhances the efficiency and accuracy of our investigation. Our in house developed mobile application allows our investigators to capture real-time data, upload images, and our Claim Management Dashboard can generate reports at the blink of an eye. This reduces the turnaround time for investigations and ensures that all information is documented accurately. We also leverage data analytics to identify patterns in claims, helping us to proactively detect potential fraud. This combination of technology and human expertise allows us to provide a comprehensive and effective motor claim investigation service.","assets/Service images/Motor-MACT/car accident.jpg",q,"Motor Claim Investigation","Thorough On-Ground Verification","Technology Driven Investigation"),A.Fl(A.c(["Team of qualified doctors to manage health claims","Expert in medical documentation and treatment verification","Technology accelerated claim processing","Visits to hospital, insured and labs","Verification of medical records and policy endorsments","Detailed report generation QC by doctors"],l),"Our Health Claim Investigation service is designed with accuracy and attention to detail as its core. We understand that health insurance claims can be complex, involving multiple parties and intricate medical details. Our team of experienced investigators and doctors works closely with hospitals, insured, and the insurer to ensure that every claim is thoroughly vetted. \n\nWe specialize in verifying the authenticity of medical treatments, hospital admissions, and the legitimacy of expenses claimed. Our goal is to protect insurers from fraudulent claims while ensuring that genuine policyholders receive the benefits they are entitled to.","Our robust investigator network across Maharashtra along with dedicated investigator application and Claim management dashboard accelerates our workflow and the claim process and allows us to conduct thorough investigations efficiently and within the stipulated time frame.","Doctors are the Heart and Brain of our operations. Every Health Claim Investigation is overlooked by our team of doctors and field executives and doctors work together to ensure that every claim is thoroughly vetted. \n\nOur doctors are experts in medical documentation and treatment verification and have various medical backgrounds like MBBS, BAMS, MS, etc. allowing for a wide range of investigative expertise, especially in complex cases involving multiple treatments or surgeries and different treatment protocols. This dual approach of combining medical expertise with investigative skills ensures that we can accurately assess the legitimacy of health claims.","assets/Service images/Health/top-view-health-insurance-form-eyeglasses-with-stethoscope-wooden-background-business-healthcare-concept-savings-flat-lay-c.jpg",q,"Health Claim Investigation","Reimbursment and Cashless Claim Verification","Dedicated Team of Docotrs"),A.Fl(A.c(["Strategic Planning","Market Research","Innovation and Product Development",p],l),"As government schemes and private insurance companies expand their agricultural insurance offerings, the risk of fraudulent claims has also increased. Our Agricultural Insurance Investigation service is tailored to address this challenge by providing comprehensive audits and investigations to ensure that claims are legitimate and substantiated. \n\nWe specialize in large-scale audits that cover multiple farmers and regions, allowing us to identify patterns of fraud and implement preventive measures. Our team works closely with agricultural experts, local authorities, and insurers to ensure that every claim is thoroughly vetted. \n\nHere's what we offer:\n - Social Audits\n - Cattle Claim Investigation\n - Crop Cutting Experiments(CCE)\n - Solar Claim Investigation",n,m,"assets/service images/social/wheat.jpg",q,"Agricultural Insurance Investigation",o,"Large Scale Audits for early detection of frauds and claims"),A.Fl(A.c(["Pre/Post Employment Verification","Background Checks","Customized Investigations","Innovative Investigative Techniques","Detailed Evidence Collection","Well structured, detailed and easy to understand reports"],l),"Implementation services involve the practical execution of plans...",n,m,q,q,"Corporate Investigation",o,"Third Party Investigation, Claim Verification, and Fraud Detection"),A.Fl(A.c(["Expert Tracking Team","State of the art infrastructure","Real time tracking","Round the clock operations 24/7, 365 days","Constant communication with the drivers","Proper escalation matrix","Proper documentation and reporting"],l),"The Marine Consignment Tracking project began back in 2014, when we were approached to carry out this pilot project. We began with monitoring of 10 vehicles daily. It was a huge success and what was a small pilot project has turned into a huge operation with over 2500 vehicles being monitored daily by us. We now handle consignment tracking for various clients and monitor upwards of 250Cr worth of goods daily.\nStarting this project has benefit many clients prevent losses and maximise recovery rate in case something goes south and is essential for any business that relies on the transportation of goods, especially those that are high value and volatile.","We are the only Consignment Tracking company in India that has a dedicated team of experts who are available 24/7, 365 days a year. Along with this we have state-of-the-art infrastructure and a team of dedicated experts that allows us to track your consignment in real time, from any transporters tracking dashboard. Our teams work in 3 shifts with some overlap to ensure no vehicle or triggers go unnoticed, along with a proper escelation matrix, documentation and SOP in place.","Our team is continuouly in contact with the drivers to ensure that the driver and the consignment both are safe and on track. We ensure the driver halts at the right geotagged locations, and follows the driving policy of our clients. We also have a proper documentation and reporting system in place to ensure that the consignment is being monitored and tracked at all times and are able to support to the driver in case of any emergency, either from us or from the local police.","assets/Service images/Marine/ChatGPT Image May 10, 2025, 04_01_15 PM.png","assets/Service images/Marine/trucks port.jpg","Marine Consignment Tracking","24/7 Real time Monitoring","Driver Coordination across India")],A.ag("y<Fk>"))})
